import React from "react";

// Proptypes
import PropTypes from "prop-types";

// Styles
import { Wrapper, Content } from "./Header.styles";

// Components
import AddButton from "../AddButton";

const Header = ({ title }) => (
  <Wrapper>
    <Content>
      <h1>{title}</h1>
    </Content>
    <AddButton onClick/>
  </Wrapper>
);

Header.defaultProps = {
  title: "Task Tracker",
};

Header.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Header;
